import CadastroForm from '../cadastro/CadastroForm';
import styles from './Pages.module.css';

export default function Cadastro({props}) {


    return(
        <div className={styles.cadastro_container}>
          <h1>Novo cadastro</h1>
          <p>Cadastro de novos funcionários</p>
          <CadastroForm/>
        </div> 
      )
}
